import React from 'react';

const Slider = ({key, que}) => {
	const data = JSON.parse(sessionStorage.getItem(que));
	const max = data.max;
	const step = data.step;
	
	return (
		<fieldset disabled>
			<div key={`${que}_${key}`}>
				<div>{que}</div>
				<input type="range" min={0} max={max} step={step} disabled={true}/>
			</div>
		</fieldset>
	);
};

export default Slider;
